import '../css/main.css';
import '../css/navbar.css';
import Navbar from 'react-bootstrap/Navbar';

function HeaderNav() {
  return (
    <Navbar.Toggle id="navbar-container" expand="sm">
      <Nav>
        <Nav.Link></Nav.Link>
        <Nav.Link></Nav.Link>
        <Nav.Link></Nav.Link>
      </Nav>
    </Navbar.Toggle>
  );
}

export default HeaderNav;
